import React  from 'react';
import dataCodir from './dataCodir';

const Groupe5 = () => {

   const data= dataCodir.map((data)=>(
      <div>
               <img 
               style={{
                  borderRadius:'50%'
               }}
                src={data.photo} alt=''/>
               <h1>{data.name}</h1>
               <h3>{data.poste}</h3>

      </div>

   ))

    return (
        <div className='container'>
        <div className='gridr3'>
           {data} 
        </div>



     </div>
    )
  }

export default Groupe5;
